import React, { useState } from 'react';
import axios from 'axios';
import { Input } from './ui/input';
import { Button } from './ui/button';

// Replace with your actual API key
const GOOGLE_MAPS_API_KEY = 'YOUR_API_KEY';

const StateSearch = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [error, setError] = useState(null);

  const handleSearch = async () => {
    if (searchTerm.length >= 2) {
      try {
        const response = await axios.get(`http://127.0.0.1:5000/api/search`, {
          params: { state: searchTerm }
        });
        setSearchResult(response.data);
        setError(null);
      } catch (err) {
        console.error('Error:', err);
        setError('Error fetching data');
        setSearchResult(null);
      }
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <div className="flex space-x-2 mb-4">
        <Input
          type="text"
          placeholder="Enter a state (e.g., Texas)"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <Button onClick={handleSearch}>Search</Button>
      </div>

      <div className="mt-6">
        {error && (
          <div className="text-red-500 p-4 rounded-md bg-red-50">{error}</div>
        )}
        
        {searchResult && !error && (
          <div className="bg-white rounded-lg shadow-lg overflow-hidden">
            <div className="p-6">
              <h2 className="text-2xl font-bold mb-4">{searchResult.name}</h2>
              
              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                <div>
                  <div className="space-y-4">
                    <p className="font-semibold">Winner: <span className="font-normal">{searchResult.winner}</span></p>
                    <p className="font-semibold">Margin: <span className="font-normal">{searchResult.margin}%</span></p>
                    <p className="font-semibold">2024 Betting Odds: <span className="font-normal">{searchResult.odds}</span></p>
                  </div>

                  <div className="mt-6">
                    <h3 className="text-lg font-semibold mb-4">Voting Percentages</h3>
                    
                    <div className="space-y-4">
                      <div>
                        <p className="mb-2">Democratic: {searchResult.dem_percentage}</p>
                        <div className="h-4 bg-gray-200 rounded-full overflow-hidden">
                          <div 
                            className="h-full bg-blue-600 transition-all duration-300"
                            style={{ width: searchResult.dem_percentage }}
                          ></div>
                        </div>
                      </div>

                      <div>
                        <p className="mb-2">Republican: {searchResult.rep_percentage}</p>
                        <div className="h-4 bg-gray-200 rounded-full overflow-hidden">
                          <div 
                            className="h-full bg-red-600 transition-all duration-300"
                            style={{ width: searchResult.rep_percentage }}
                          ></div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>

                <div>
                  <h3 className="text-lg font-semibold mb-4">State Map</h3>
                  <div className="aspect-video rounded-lg overflow-hidden">
                    <iframe
                      width="100%"
                      height="100%"
                      className="border-0"
                      loading="lazy"
                      allowFullScreen
                      referrerPolicy="no-referrer-when-downgrade"
                      src={`https://www.google.com/maps/embed/v1/place?key=${GOOGLE_MAPS_API_KEY}&q=${searchResult.name}+state+USA&zoom=6`}
                    ></iframe>
                  </div>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default StateSearch;
